function Movie() {
  return (
    <div>
      {movie.map((movies) => (
        <div>
          <img src={movies.medium_cover_image}></img>
          <h3>{movies.title}</h3>
          <p>{movies.summary}</p>
          <ul>
            {movies.genres.map((g) => (
              <li>{g}</li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
}

